      },
      {
        code: 'ru-RU',
        name: '–†—É—Å—Å–∫–∏–π',
        file: 'ru-RU.json',
      },
      {
        code: 'fr-FR',
        name: 'Fran√ßais',
        file: 'fr-FR.json',
      },
      {
        code: 'uk-UA',
        name: '–£–∫—Ä–∞—ó–Ω—Å—å–∫–∞',
        file: 'uk-UA.json',
      },
    ],
    lazy: true,
    langDir: 'internationalization',
    defaultLocale: 'en',
  },
  htmlValidator: {
    usePrettier: false,
    logLevel: 'verbose',
    failOnError: false,
